import { ImageResponse } from 'next/og'
import { Carlito } from 'next/font/google'

const carlito = Carlito({ 
  weight: ['400', '700'],
  subsets: ["latin"] 
});
 
export async function GET(request) {
  const searchParams = request.nextUrl.searchParams
  const title = searchParams.get('title')
  const subtitle = searchParams.get('subtitle')

  const image64 = "data:image/jpeg;base64,"

  return new ImageResponse(
    (
      <div
        style={{
          width: '100%',
          height: '100%',
          display: 'flex',
          textAlign: 'center',
          alignItems: 'center',
          justifyContent: 'center',
          backgroundColor: '#111',
        }}
      >
        <img src={image64} style={{ position: 'absolute', top: 0, width: '100%', opacity: 0.2 }} />
        
        <div style={{
          display: 'flex',
          flexDirection: 'column',
          color: '#fff',
        }}>

          <div style={{
            fontSize: '76px',
            fontWeight: 'bold',
          }}>
            {title ? `${title}'s` : "Create"}
          </div>

          <div style={{
            fontSize: '48px',
            fontWeight: 'lighter',
            opacity: 0.6,
          }}>
            {`${subtitle || "Your Resume Website"}`}
          </div>

        </div>
      </div>
    ),
    {
      width: 1200,
      height: 600,
    }
  )
}